INSERT INTO `cf_cms_block` (`block_id`, `title`, `identifier`, `content`, `creation_time`, `update_time`, `is_active`)
VALUES
	(1,'Header Top Block ','top_block','<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-sm-6 col-md-6 col-lg-6 col-xs-12\"><span class=\"price-txt\">Custom Framing Buy it for <b>$149.99</b></span></div>\r\n<div class=\"col-sm-6 col-md-6 col-lg-6 col-xs-12\">\r\n<ul class=\"info-txt\">\r\n<li><img src=\"{{media url=\"wysiwyg/icon/icon-envelop.png\"}}\" alt=\"\" /> <a href=\"mailto:support@celebrityframing.com\" target=\"_top\">support@celebrityframing.com</a></li>\r\n<li><img src=\"{{media url=\"wysiwyg/icon/icon-phone.png\"}}\" alt=\"\" /> (987)654-3210</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>','2017-06-02 10:06:12','2017-06-06 15:02:40',1),
	(2,'Home Page started','started','<div class=\"banner-bg\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-10 col-md-12 col-sm-12 col-lg-offset-1\">\r\n<div class=\"banner-content-area\">\r\n<div class=\"border-box-txt\">THE SIMPLEST WAY TO <span>CUSTOM FRAME</span></div>\r\n<div class=\"row\">\r\n<div class=\"col-lg-6 col-md-13 col-sm-12\"><a class=\"btn-custom red\" href=\"{{store url=\"frameeditor\"}}\"><span class=\"pull-left\">GET STARTED</span><span class=\"pull-right\"><img src=\"{{media url=\"wysiwyg/icon/icon-started.png\"}}\" alt=\"\" /></span></a></div>\r\n<div class=\"col-lg-6 col-md-13 col-sm-12\"><a class=\"btn-custom blue\" href=\"{{store url=\"frames\"}}\"><span class=\"pull-left\">Browse frames</span><span class=\"pull-right\"><img src=\"{{media url=\"wysiwyg/icon/icon-search.png\"}}\" alt=\"\" /></span></a></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<a class=\"down-arrow\" href=\"javascript:void(0)\"><img src=\"{{media url=\"wysiwyg/icon/icon-downarrow.png\"}}\" alt=\"\" /></a>\r\n</div>','2017-06-02 13:48:27','2017-07-24 06:11:01',1),
	(3,'Home page How it works','home_works','<div class=\"four-blog-box\">\r\n<div class=\"container\">\r\n<h2 class=\"row-heading\">How it <span>works</span></h2>\r\n<div class=\"row\">\r\n<div class=\"col-lg-3 col-md-6 col-sm-6\">\r\n<div class=\"works-section-box\">\r\n<div class=\"diamond-box\"><span class=\"inside-icon-img\"><img src=\"{{media url=\"wysiwyg/icon/icon-works3.png\"}}\" alt=\"\" /></span></div>\r\n<h4>Find your frame</h4>\r\n</div>\r\n</div>\r\n<div class=\"col-lg-3 col-md-6 col-sm-6\">\r\n<div class=\"works-section-box\">\r\n<div class=\"diamond-box\"><span class=\"inside-icon-img\"><img src=\"{{media url=\"wysiwyg/icon/icon-works1.png\"}}\" alt=\"\" /></span></div>\r\n<h4>Upload Your Image</h4>\r\n</div>\r\n</div>\r\n<div class=\"col-lg-3 col-md-6 col-sm-6\">\r\n<div class=\"works-section-box\">\r\n<div class=\"diamond-box\"><span class=\"inside-icon-img\"><img src=\"{{media url=\"wysiwyg/icon/icon-works2.png\"}}\" alt=\"\" /></span></div>\r\n<h4>Choose Matt, Embellishment, Plate from library</h4>\r\n</div>\r\n</div>\r\n<div class=\"col-lg-3 col-md-6 col-sm-6\">\r\n<div class=\"works-section-box\">\r\n<div class=\"diamond-box\"><span class=\"inside-icon-img\"><img src=\"{{media url=\"wysiwyg/icon/icon-works4.png\"}}\" alt=\"\" /></span></div>\r\n<h4>Preview it &amp; receive it</h4>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>','2017-06-02 13:55:16','2017-08-04 07:06:55',1),
	(4,'Home Page frame game','home_game','<div class=\"introducing-box\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-12 col-md-12 col-sm-12\">\r\n<div class=\"inside-txt\">\r\n<h2><span>We are introducing </span>FRAME-TASTIC (Savings) <span> at only $149.99</span></h2>\r\n</div>\r\n<a class=\"btn-frame\" href=\"{{store url=\"frameeditor\"}}\">GET STARTED</a></div>\r\n</div>\r\n</div>\r\n</div>','2017-06-02 14:06:32','2017-08-04 07:08:46',1),
	(5,'Home Page easy steps','home_steps','<div class=\"upload-box\">\r\n<div class=\"container\">\r\n<h2 class=\"row-heading\">Two easy ways <span>to do it</span></h2>\r\n<div class=\"row\">\r\n<div class=\"col-lg-6 col-md-6 col-sm-12\">\r\n<div class=\"info-details-box\"><span class=\"icon-area\"><img src=\"{{media url=\"wysiwyg/icon/icon-upload2.png\"}}\" alt=\"\" /></span>\r\n<p>Select frame and embellishments and receive frame at your doorstep</p>\r\n<a class=\"btn-custom blue\" href=\"{{store url=\"frameeditor\"}}\">Get Started</a></div>\r\n</div>\r\n<div class=\"col-lg-6 col-md-6 col-sm-12\">\r\n<div class=\"info-details-box\"><span class=\"icon-area\"><img src=\"{{media url=\"wysiwyg/icon/icon-upload1.png\"}}\" alt=\"\" /></span>\r\n<p>Choose frames through us and you assembled it</p>\r\n<a class=\"btn-custom red\" href=\"{{store url=\"frames\"}}\">Browse Frames</a></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>','2017-06-02 14:08:23','2017-08-04 07:14:02',1);
